import { Component } from '@angular/core';

@Component({
  selector: 'app-navigatebar',
  templateUrl: './navigatebar.component.html',
  styleUrls: ['./navigatebar.component.css']
})
export class NavigatebarComponent {
  isShowing: boolean;

toggleSidenav() {
   this.isShowing = !this.isShowing;
}

callMethods() {
    this.toggleSidenav();
}
}
